import Ecom from "../Ecom.js";

export default function Product() {
  const dataLoad = async () => {
    let token = JSON.parse(Ecom.getCookie("session-member-record"));
    console.log(token["access_token"]);
    const res = await fetch(
      "http://127.0.0.1:8000/api/product/select-products",
      {
        headers: new Headers({
          Authorization: "Bearer " + token["access_token"],
        }),
      }
    );
    let req = await res.json();
    console.log(req);
  };
  dataLoad();
  return (
    <>
    <div className="container">
      <div className="row">
        <div className="col-md-3">
          <div class="card">
            <img src="https://thermaltake.azureedge.net/pub/media/catalog/product/cache/6bf0ed99c663954fafc930039201ed07/l/2/l20m01.jpg" class="card-img-top" alt="..." />
